$(document).ready(function() {
  var oTable;

  // 'open' an information row when a row is clicked on
  $('#example tbody tr').click( function () {
    if ( oTable.fnIsOpen(this) ) {
      oTable.fnClose( this );
    } else {
      oTable.fnOpen( this, "Temporary row opened", "info_row" );
    }
